import React from "react";
import { connect } from "react-redux";
import { changeNumberOfPairs } from "../redux/actions/index";
import { Layout } from "antd";
import styled from "styled-components";
import Control from "../components/Control";
import Grid from "../components/Grid";
const { Content, Sider } = Layout;

function App(props) {
  return (
    <Layout>
      {/* <button onClick={() => props.changeNumberOfPairs(90)}>change</button>
      <div>number of pairs : {props.numberOfPairs}</div>
      <Button type="primary">Button</Button> */}

      <Content>
        <Grid />
      </Content>
      <Sider theme="light">
        <Control />
      </Sider>
    </Layout>
  );
}

const mapStateToProps = (state) => ({
  cards: state.cards,
  numberOfPairs: state.numberOfPairs,
});

const mapDispatchToProps = (dispatch) => ({
  changeNumberOfPairs: (number) => dispatch(changeNumberOfPairs(number)),
});

export default connect(mapStateToProps, mapDispatchToProps)(App);
const testStyle = styled.div`
  font-size: 30px;
  color: blue;
`;
